import React from 'react';
import Index from './complementos/Index';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
    <Switch>

    <Route path="/home">
      <Index/>
    </Route>


  </Switch>
</Router>
);

}

export default App;
